import React from "react";

const conteudos = [
  {
    conteudo: 'High Order Functions',
    bloco: 8,
    status: 'Aprendido'
  },
  {
    conteudo: 'Composicao de Componentes',
    bloco: 11,
    status: 'Aprendendo',
  },
  {
    conteudo: 'Composicao de Estados',
    bloco: 12,
    status: 'Aprenderei'
  },
  {
    conteudo: 'Redux',
    bloco: 16,
    status: 'Aprenderei'
  },
];

class Content extends React.Component {
  render() {
    return <p> {conteudos.map((conteudo) => {
      const template = `O conteúdo é: ${conteudo.conteudo} ;
      Status: ${conteudo.status} ;
      Bloco: ${conteudo.bloco} ;`
      return template;
    }) }</p>
  }
}

export default Content;
